INSERT INTO `v1_47ef9d0b364574b0834f9efaca1f9b7252cdb199725f848f794786ec3c7ea026` VALUES (602000406, "boss_tp_down_cut", "バトル開始時、すべてのモンスターがＴＰダウン\n50％カット状態になる。", "ＴＰダウンカット", 76020004);
INSERT INTO `v1_47ef9d0b364574b0834f9efaca1f9b7252cdb199725f848f794786ec3c7ea026` VALUES (602000501, 18, "すべてのモンスターが一度の行動で受けるダメージ値を減衰させる。ダメージ値が上昇するほど減衰率も上昇する。", "ダメージ減衰", 76020005);
INSERT INTO `v1_47ef9d0b364574b0834f9efaca1f9b7252cdb199725f848f794786ec3c7ea026` VALUES (602000502, 17, "バトル開始時、すべてのキャラのＴＰ上昇の上限値を150にする。", "ＴＰ上昇上限付与", 76020005);
INSERT INTO `v1_47ef9d0b364574b0834f9efaca1f9b7252cdb199725f848f794786ec3c7ea026` VALUES (602000503, "boss_def_lower_limit", "バトル開始時、すべてのモンスターの物理防御力を中アップさせる。この効果は物理防御力ダウンの影響を受けない。", "物理防御力（ダウン不可）アップ", 76020005);
INSERT INTO `v1_47ef9d0b364574b0834f9efaca1f9b7252cdb199725f848f794786ec3c7ea026` VALUES (602000504, "boss_magic_def_lower_limit", "バトル開始時、すべてのモンスターの魔法防御力を中アップさせる。この効果は魔法防御力ダウンの影響を受けない。", "魔法防御力（ダウン不可）アップ", 76020005);
INSERT INTO `v1_47ef9d0b364574b0834f9efaca1f9b7252cdb199725f848f794786ec3c7ea026` VALUES (602000505, 9, "バトル開始時、すべてのキャラのＨＰ吸収を特大ダウンさせる。", "ＨＰ吸収ダウン", 76020005);
INSERT INTO `v1_47ef9d0b364574b0834f9efaca1f9b7252cdb199725f848f794786ec3c7ea026` VALUES (602000506, "boss_tp_down_cut", "バトル開始時、すべてのモンスターがＴＰダウン\n50％カット状態になる。", "ＴＰダウンカット", 76020005);
